import React from "react"

import projectData from "../portfolio_data/projectData"
import Project from "./Project"

function HtmlSettings(container, h2, p, icon, ul, pos){
    this.container = container;
    this.h2 = h2;
    this.p = p;
    this.icon = icon;
    this.ul = ul;
    this.pos = pos;
}

function MainContentPortfolio(){
    let i = 0;
    const myProjects = projectData.map(function(data){
        let htmlsettings;
        if(i % 2 == 0){
            htmlsettings = new HtmlSettings("container_gray", "h2_left", "p_left", "icon_left", "ul_left", "l")
        }
        else{
            htmlsettings = new HtmlSettings("container_white", "h2_right", "p_right", "icon_right", "ul_right", "r")
        }
        i++;
        return <Project key={data.id} project={data} htmlsetting={htmlsettings}/>
    })

    return (
        myProjects
    )
}

export default MainContentPortfolio
